customPostExtractionLogic:
using System;
using System.IO;
using System.Linq;
using System.Collections.Generic;
using Datum.Rapid.Capture.Common.DomainModel;
using Datum.Rapid.Capture.Common.DomainModel.Common;

namespace StudioDesigner.Customization.Extraction
{
    public class ExampleCustomFieldExtractor : CustomFieldExtractor
    {
        public ExampleCustomFieldExtractor(ref ExtractionContext extractionContext, List<FieldGroup> fieldGroups) :
            base(ref extractionContext, fieldGroups)
        {
        }

        public override void PostExtract()
        {
            var relevantFieldGroup = FieldGroups.FirstOrDefault();
            if (relevantFieldGroup == null){ 
                return; 
            }
            
            var eobGroup = relevantFieldGroup.ChildFieldGroups.FirstOrDefault(x => "eob_details" == x.ExternalId);

            var lastName = eobGroup.Fields.FirstOrDefault(x => "eob_last_name_hidden" == x.ExternalId);
            var firstName = eobGroup.Fields.FirstOrDefault(x => "eob_first_name_hidden" == x.ExternalId);
            var patName = eobGroup.Fields.FirstOrDefault(x => "eob_pat_name" == x.ExternalId);

            if (lastName.Values.First().Value.Length > 0 && firstName.Values.First().Value.Length > 0 && patName.Values.First().Value.Length == 0)
            {
                    patName.Values.First().Value = firstName.Values.First().Value + " " + lastName.Values.First().Value;
            }
            
        }
    }
}
